import React from "react";
import { useSelector } from "react-redux";
import OrderDetail from "../../component/OrderDetail/OrderDetail";
import "./CompletedOrder.scss";

function CompletedOrder() {
  const finalInfo = useSelector(cart=>cart.cart);
  const date = new Date()
  const today = `${date.getDate()}/${date.getMonth()}/${date.getFullYear()}`;
  const cartInfoSection = JSON.parse(sessionStorage.getItem("item_cart"));
  console.log(finalInfo);
  const finalInfoMap = {
    idOrder: "#100000326",
    orderDate: today,
    payMethod:
      finalInfo.paymentMethod.title || cartInfoSection.paymentMethod.title,
    listProduct: finalInfo.cartList,
    intoMoney: finalInfo.totalPay || cartInfoSection.paymentMethod.totalPay,
  };

  return (
    <div className="ContainerCompletedOrder">
      <OrderDetail orderDetail={finalInfoMap} />
    </div>
  );
}

export default CompletedOrder;
